  return (
    <div>
      <img src="../recursos/landingimagen.png" alt="imagen de fondo" />
      <h1>Bienvenidos todos a la pokemon web!</h1>
      <Link to="/home">
        <button>START</button>
      </Link>
    </div>
  );
}
